import React from "react";
import { VictoryPie,VictoryLegend } from "victory";
import './StylePie.css';

const PieChart = () => {
  return (
      <div>
    <div className="pie-chart">
      <VictoryPie
        style={{ labels: { fill: "none" } }}
        innerRadius={100}
        colorScale="blue"
        data={[
          { x:"IOS", y:80 },
          { x:"Android",y:20 }
        ]}
      />
    </div>
    <div>
        <VictoryLegend></VictoryLegend>
    </div>
    </div>
  );
};
export default PieChart;
